    console.log(data)
    return (
        <>  
        <div className='itemGrid'>
        {
        data.map((element) => {
                return (<>
                <Item sellerTitle={element.sellerTitle} image={element.image} itemTitle={element.itemTitle} itemDesc={element.itemDesc} price={element.price}/>
                
                </>)
        })
        }
        </div>
        </>
    )
}
